svg.script:
    var timeline = new TimelineMax({onComplete:onComplete});

timeline.addLabel("time_track1", 0.25);

var tweens = TweenMax.staggerTo(".rayLine",1000,{ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":-20000}, .35);

for(var i=0;i<tweens.length;i++){
	var tween = tweens[i];
	tween.progress(Math.random()+0.5);
	tween.timeScale(Math.random()+0.5);
}

timeline.set("svg", {opacity:1});

timeline.staggerFrom(".mainLineEnd", .15, {ease:Power2.easeOut, scale:.0001, transformOrigin:"center", repeat:-1, yoyo:true, repeatDelay:.25},.1, "time_track1-=2");
timeline.staggerFrom(".topLineEnd", .15, {ease:Power2.easeOut, scale:.0001, transformOrigin:"center", repeat:-1, yoyo:true, repeatDelay:.5}, .1, "time_track1-=2");
timeline.staggerFrom(".bottomLineEnd", .15, {ease:Power2.easeOut, scale:.0001, transformOrigin:"center", repeat:-1, yoyo:true, repeatDelay:.75},.1, "time_track1-=2");
timeline.fromTo(".largeBurst", 2.5, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":0}, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":-40}, "time_track1");
timeline.fromTo(".smallBurst", 2.5, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":0}, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":-40}, "time_track1-=1");

timeline.staggerFrom("#circleTrail circle", .5, {scale:0.0001, ease:Power2.easeInOut, yoyo:true, repeat:-1, transformOrigin:"center", repeatDelay:.5}, .1, "time_track1");
timeline.staggerFrom("#bottomLeft circle", .5, {scale:0.0001, ease:Power2.easeInOut, yoyo:true, repeat:-1, transformOrigin:"center", repeatDelay:1}, .1, "time_track1");
timeline.staggerFrom("#topRight circle", .5, {scale:0.0001, ease:Power2.easeInOut, yoyo:true, repeat:-1, transformOrigin:"center", repeatDelay:1}, .1, "time_track1");

timeline.staggerFrom("#outsideGrowingCircle line", 1, {scale:.0001, ease:Power2.easeInOut, transformOrigin:"center", yoyo:true, repeat:-1, repeatDelay:.5},.1, "time_track1");
timeline.staggerFrom("#insideGrowingCircle line", 1, {scale:.0001, ease:Power2.easeInOut, transformOrigin:"center", yoyo:true, repeat:-1},.08, "time_track1-=1.5");

timeline.to(".key2", 2, {y:-930, ease:Sine.easeInOut, yoyo:true, repeat:-1}, "time_track1-=4");
timeline.to("#aboveLine", 2, {scaleY:1.69, transformOrigin:"50% 0%", ease:Sine.easeInOut, repeat:-1, yoyo:true}, "time_track1-=4");
timeline.to("#belowLine", 2, {scaleY:.46, transformOrigin:"50% 100%", ease:Sine.easeInOut, repeat:-1, yoyo:true}, "time_track1-=4");

timeline.to(".key1", 2, {x:-21, ease:Sine.easeInOut, yoyo:true, repeat:-1}, "time_track1-=4");
timeline.to("#rightLine", 2, {scaleX:1.69, transformOrigin:"100% 50%", ease:Sine.easeInOut, repeat:-1, yoyo:true}, "time_track1-=4");
timeline.to("#leftLine", 2, {scaleX:.46, transformOrigin:"0% 520%", ease:Sine.easeInOut, repeat:-1, yoyo:true}, "time_track1-=4");

timeline.fromTo(".dashedBreathLine", 200, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":0}, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":3000}, "time_track1-=.25");

timeline.fromTo(".dashedSliderLineDark", 200, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":100}, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":4100}, "time_track1-=.25");
timeline.fromTo(".dashedSliderLineTeal", 200, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":0}, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":4000}, "time_track1-=.25");
timeline.fromTo(".dashedSliderLineDark2", 200, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":100}, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":-3900}, "time_track1-=.25");
timeline.fromTo(".dashedSliderLineTeal2", 200, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":0}, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":-4000}, "time_track1-=.25");

timeline.staggerFrom(".floatingCenter", .3, {scale:.0001, transformOrigin:"center", ease:Linear.easeNone, yoyo:true, repeat:-1, repeatDelay:.35}, .5, "time_track1");
timeline.staggerFrom(".floatingCenter2", .3, {scale:.0001, transformOrigin:"center", ease:Linear.easeNone, yoyo:true, repeat:-1, repeatDelay:.35}, .35, "time_track1+=.25");
timeline.staggerFrom(".floatingCenter3", .3, {scale:.0001, transformOrigin:"center", ease:Linear.easeNone, yoyo:true, repeat:-1, repeatDelay:.35}, .35, "time_track1+=.5");
timeline.fromTo(".floatingCenterDash", 50, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":0}, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":1000}, "time_track1");

var isComplete=true;
function onComplete(){
	isComplete=true;
}
